import React from "react";
import List from "../../src/moveOutList.json";

const MoveOutList = () => {
  return (
    <div>
      Move-out-listx
      {List.map((MoveList, index) => {
        return <div>{MoveList.address}</div>;
      })}
    </div>
  );
};

export default MoveOutList;

   <div className="box-container">
        <div>
          <table className="styled-table">
            <thead className="table-header">
              <tr>
                <th>Full Name</th>
                <th>Email</th>
                <th>Stack</th>
                <th>Squad</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {List.map(() => (
                <tr className="table-row">
                    <td>
                      {MoveList.firstname}
                    </td>
                    <td>{MoveList.email}</td>
                    <td>{MoveList.stack}</td>
                    <td>{MoveList.squad}</td>
                    <td className="dropdown">

                    </td>
                    </tr>
                    ))}
                </tbody>
          </table>
        </div>
      </div>
